// SpeciesList.js
import React, { useState } from 'react';
import SpeciesCard from './SpeciesCard';
import AddSpeciesForm from './AddSpeciesForm';


const SpeciesList = () => {
  const [speciesList, setSpeciesList] = useState([]);

  const handleAddSpecies = (newSpecies) => {
    setSpeciesList((prevList) => [...prevList, newSpecies]);
  };

  return (
    <div className="species-list">
      <h2>Species List</h2>
      <AddSpeciesForm onAdd={handleAddSpecies} />
      <div className="species-cards">
        {speciesList.map((species, index) => (
          <SpeciesCard key={index} species={species} />
        ))}
      </div>
    </div>
  );
};

export default SpeciesList;
